import React from 'react';
import './App.css';

class App extends React.Component {

  constructor(props){
    super(props);
    this.state = {
      apiRes : ''
    };
  }

  componentWillMount(){
    fetch('http://localhost:9000/api')
      .then(res => res.text())
      .then(res => this.setState({apiRes : res}));
  }

  render(){
    return (
      <div>
        <h2>
          {this.state.apiRes}
        </h2>
      </div>
    );
  }
}

export default App;
